(489, 1, 'admin/cars/12', 'PUT', '127.0.0.1', '{\"car_name\":\"toyota 86 (tokyo) used car\",\"desc_en\":\"A two-door sports coupe jointly developed by Toyota and Fuji Heavy Industries. Toyota\'s direct injection technology D-4S and Subaru\'s horizontally opposed engine are combined to achieve an ultra-low center of gravity by installing it in the front midship. The new unit delivers a maximum output of 200 ps and a maximum torque of 205 Nm, while also achieving excellent environmental performance of 13.4 km\\/L (the lightest grade) in JC08 mode fuel economy. The exterior expresses with its whole body that it is a sport with a low center of gravity, such as the low front hood unique to vehicles with horizontally opposed engines and the wide and stable rear design. The interior has a sporty cockpit space with a layout that takes into account the flow line of the driver\'s hand (2012.4)\",\"cate_id\":\"2\",\"brand_id\":\"1\",\"year_id\":\"1\",\"city_id\":\"1\",\"color\":\"#ff0000\",\"price\":\"5000\",\"engine\":\"1998cc\",\"gearbox\":\"hrand gearbox\",\"wattage\":\"5000hp\",\"moment\":\"200\\uff5e219ps\",\"kilometer\":\"30000\",\"vehicle_inspection\":\"Vehicle inspection balance: None (newly acquired at the time of purchase\\r\\n) The total payment includes the costs required to acquire the vehicle inspection (vehicle weight tax, automobile liability insurance, etc.).\\r\\nVehicle inspection and maintenance with\\r\\nvehicle inspection and maintenance (legal 24-month inspection and maintenance \\/ 12 months for commercial vehicles) will be carried out. The cost is included in the main unit price.\",\"Legal_maintenance\":\"With statutory maintenance With\\r\\nstatutory 24-month inspection and maintenance * Commercial vehicles have 12-month inspection and maintenance. At\\r\\na BMW specialty store, you can rest assured that any repairs and daily maintenance will be done. Not only maintenance before delivery, but also after delivery, we will inspect and maintain every corner of your car to provide you with peace of mind.\",\"guarantee\":\"With warranty: Dealer warranty Warranty period: 1 month Warranty distance: 1,000km\\r\\nGuarantee cost is included in the main unit price. Check with your retailer for more information.\\r\\nOur in-house warranty is 1000km per month, but we have prepared a separate [national warranty]. Regardless of the region, it is a guarantee that you can receive it at a local affiliated factory, so please consider it with confidence even for customers far away.\",\"car_name_jp\":\"\\u30c8\\u30e8\\u30bf 86\\uff08\\u6771\\u4eac\\u90fd\\uff09\\u306e\\u4e2d\\u53e4\\u8eca\",\"desc_jp\":\"\\u30c8\\u30e8\\u30bf\\u3068\\u5bcc\\u58eb\\u91cd\\u5de5\\u304c\\u5171\\u540c\\u958b\\u767a\\u3057\\u305f2\\u30c9\\u30a2\\u30b9\\u30dd\\u30fc\\u30c4\\u30af\\u30fc\\u30da\\u3002\\u30c8\\u30e8\\u30bf\\u306e\\u76f4\\u5674\\u6280\\u8853D-4S\\u3068\\u30b9\\u30d0\\u30eb\\u306e\\u6c34\\u5e73\\u5bfe\\u5411\\u30a8\\u30f3\\u30b8\\u30f3\\u3092\\u7d44\\u307f\\u5408\\u308f\\u305b\\u3001\\u30d5\\u30ed\\u30f3\\u30c8\\u30df\\u30c3\\u30c9\\u30b7\\u30c3\\u30d7\\u306b\\u642d\\u8f09\\u3059\\u308b\\u3053\\u3068\\u3067\\u3001\\u8d85\\u4f4e\\u91cd\\u5fc3\\u3092\\u5b9f\\u73fe\\u3057\\u305f\\u3002\\u3053\\u306e\\u65b0\\u30e6\\u30cb\\u30c3\\u30c8\\u306f\\u6700\\u9ad8\\u51fa\\u529b200ps\\uff0f\\u6700\\u5927\\u30c8\\u30eb\\u30af205N\\u30fbm\\u3068\\u3044\\u3046\\u51fa\\u529b\\u3092\\u767a\\u63ee\\u3057\\u306a\\u304c\\u3089\\u3001JC08\\u30e2\\u30fc\\u30c9\\u71c3\\u8cbb\\u306713.4km\\/L\\uff08\\u6700\\u8efd\\u91cf\\u30b0\\u30ec\\u30fc\\u30c9\\uff09\\u3068\\u3044\\u3046\\u512a\\u308c\\u305f\\u74b0\\u5883\\u6027\\u80fd\\u3082\\u5b9f\\u73fe\\u3002\\u30a8\\u30af\\u30b9\\u30c6\\u30ea\\u30a2\\u306f\\u6c34\\u5e73\\u5bfe\\u5411\\u30a8\\u30f3\\u30b8\\u30f3\\u642d\\u8f09\\u8eca\\u306a\\u3089\\u3067\\u306f\\u306e\\u4f4e\\u3044\\u30d5\\u30ed\\u30f3\\u30c8\\u30d5\\u30fc\\u30c9\\u3084\\u3001\\u30ef\\u30a4\\u30c9\\u3067\\u5b89\\u5b9a\\u611f\\u306e\\u3042\\u308b\\u30ea\\u30a2\\