(699, 1, 'admin/cars/12', 'PUT', '127.0.0.1', '{\"car_name\":\"toyota 86 (tokyo) used car\",\"desc_en\":\"A two-door sports coupe jointly developed by Toyota and Fuji Heavy Industries. Toyota\'s direct injection technology D-4S and Subaru\'s horizontally opposed engine are combined to achieve an ultra-low center of gravity by installing it in the front midship. The new unit delivers a maximum output of 200 ps and a maximum torque of 205 Nm, while also achieving excellent environmental performance of 13.4 km\\/L (the lightest grade) in JC08 mode fuel economy. The exterior expresses with its whole body that it is a sport with a low center of gravity, such as the low front hood unique to vehicles with horizontally opposed engines and the wide and stable rear design. The interior has a sporty cockpit space with a layout that takes into account the flow line of the driver\'s hand (2012.4)\",\"cate_id\":\"2\",\"brand_id\":\"1\",\"year_id\":\"1\",\"city_id\":\"1\",\"color\":\"#ff0000\",\"price\":\"5000\",\"kilometer\":\"30000\",\"vehicle_inspection\":\"Vehicle inspection balance: None (newly acquired at the time of purchase\\r\\n) The total payment includes the costs required to acquire the vehicle inspection (vehicle weight tax, automobile liability insurance, etc.).\\r\\nVehicle inspection and maintenance with\\r\\nvehicle inspection and maintenance (legal 24-month inspection and maintenance \\/ 12 months for commercial vehicles) will be carried out. The cost is included in the main unit price.\",\"Legal_maintenance\":\"With statutory maintenance With\\r\\nstatutory 24-month inspection and maintenance * Commercial vehicles have 12-month inspection and maintenance. At\\r\\na BMW specialty store, you can rest assured that any repairs and daily maintenance will be done. Not only maintenance before delivery, but also after delivery, we will inspect and maintain every corner of your car to provide you with peace of mind.\",\"guarantee\":\"With warranty: Dealer warranty Warran