INSERT INTO `cars` (`car_id`, `car_name`, `car_img_primary`, `desc_en`, `desc_jp`, `brand_id`, `cate_id`, `model_id`, `city_id`, `price`, `engine`, `kilometer`, `created_at`, `updated_at`, `car_name_jp`, `year_id`, `vehicle_inspection`, `Legal_maintenance`, `guarantee`, `vehicle_inspection_jp`, `Legal_maintenance_jp`, `guarantee_jp`, `hand_id`, `engine_id`, `chassis_end_number`, `displacement`, `drive_system`, `mission`, `mission_jp`, `riding_capacity`, `number_of_doors`, `release_date`, `body_dimensions`, `number_of_sheet_rows`, `indoor`, `JC08_fuel_economy`, `t_1015_Fuel_economy`, `wheelbase`, `fuel_used`, `vehicle_weight`, `new_drive_system`, `WLTC_fuel_economy`, `minimum_turning_radius`, `repair_history`, `periodic_inspection_record_book`, `non_smoking_car`, `recycling_fee`, `test_drive`, `eco_car_tax_reduction_target_car`, `one_owner`, `camper`, `welfare_vehicles`, `new_car_property`, `regular_imported_car`, `registered_unused_vehicle`, `rent_a_car_up`, `new_drive_system_jp`, `Recycling_fee_jp`, `Fuel_used_jp`, `Power_steering`, `ABS`, `Adaptive_Cruise_Control`, `Parking_assist`, `Obstacle_sensor`, `Neck_impact_mitigation_headrest`, `camera`, `Electronic_stability_control`, `Idling_stop`, `Anti_theft_device`, `Support_car`, `Lane_keep_assist`, `Collision_damage_mitigation_brake`, `Accelerator_mistake`, `Airbag`, `All_around_camera`, `monitor`, `Hill_descent_control`, `Automatic_high_beam`, `Power_steering_jp`, `ABS_jp`, `Adaptive_Cruise_Control_jp`, `Parking_assist_jp`, `Obstacle_sensor_jp`, `Neck_impact_mitigation_headrest_jp`, `camera_jp`, `Electronic_stability_control_jp`, `Idling_stop_jp`, `Anti_theft_device_jp`, `Support_car_jp`, `Lane_keep_assist_jp`, `Collision_damage_mitigation_brake_jp`, `Accelerator_mistake_jp`, `Airbag_jp`, `All_around_camera_jp`, `monitor_jp`, `Hill_descent_control_jp`, `Automatic_high_beam_jp`, `color_id`, `repair_history_jp`) VALUES
(12, 'toyota 86 (tokyo) used car', 'public/upload/car//TO_S229_F001_M008_1_L.jpg', 'A two-door sports coupe jointly developed by Toyota and Fuji Heavy Industries. Toyota\'s direct injection technology D-4S and Subaru\'s horizontally opposed engine are combined to achieve an ultra-low center of gravity by installing it in the front midship. The new unit delivers a maximum output of 200 ps and a maximum torque of 205 Nm, while also achieving excellent environmental performance of 13.4 km/L (the lightest grade) in JC08 mode fuel economy. The exterior expresses with its whole body that it is a sport with a low center of gravity, such as the low front hood unique to vehicles with horizontally opposed engines and the wide and stable rear design. The interior has a sporty cockpit space with a layout that takes into account the flow line of the driver\'s hand (2012.4)', 'トヨタと富士重工が共同開発した2ドアスポーツクーペ。トヨタの直噴技術D-4Sとスバルの水平対向エンジンを組み合わせ、フロントミッドシップに搭載することで、超低重心を実現した。この新ユニットは最高出力200ps／最大トルク205N・mという出力を発揮しながら、JC08モード燃費で13.4km/L（最軽量グレード）という優れた環境性能も実現。エクステリアは水平対向エンジン搭載車ならではの低いフロントフードや、ワイドで安定感のあるリアデザインなど、低重心スポーツであることを全身で表現。室内はドライバーの手の動線を考慮したレイアウトなどにより、スポーティなコックピット空間が演出されている（2012.4）', 1, 2, 2, 1, 1000000.00, '1998cc', 30000, '2022-05-31 05:01:14', '2022-07-05 18:36:04', 'トヨタ 86（東京都）の中古車', 3, 'Vehicle inspection balance: None (newly acquired at the time of purchase\r\n) The total payment includes the costs required to acquire the vehicle inspection (vehicle weight tax, automobile liability insurance, etc.).\r\nVehicle inspection and maintenance with\r\nvehicle inspection and maintenance (legal 24-month inspection and maintenance / 12 months for commercial vehicles) will be carried out. The cost is included in the main unit price.', 'With statutory maintenance With\r\nstatutory 24-month inspection and maintenance * Commercial vehicles have 12-month inspection and maintenance. At\r\na BMW specialty store, you can rest assured that any repairs and daily maintenance will be done. Not only maintenance before delivery, but also after delivery, we will inspect and maintain every corner of your car to provide you with peace of mind.', 'With warranty: Dealer warranty Warranty period: 1 month Warranty distance: 1,000km\r\nGuarantee cost is included in the main unit price. Check with your retailer for more information.\r\nOur in-house warranty is 1000km per month, but we have prepared a separate [national warranty]. Regardless of the region, it is a guarantee that you can receive it at a local affiliated factory, so please consider it with confidence even for customers far away.', '車検残：無（購入時に新規取得）\r\n車検の取得にあたって必要な費用（自動車重量税、自賠責保険料など）が支払総額に含まれています。\r\n車検整備付\r\n車検整備（法定24ヶ月点検整備／商用車は12ヶ月）を実施致します。その費用は本体価格に含まれています。', '法定整備付\r\n法定24ヶ月点検整備付※商用車は12ヶ月点検整備付\r\nBMW専門店ならでは、どんな修理も、日々の整備も、安心してお任せください。納車前の整備はもちろん、納車後もお客様の愛車を隅々まで点検整備し、安心をお届けいたします。', '保証付：販売店保証　保証期間：1ヵ月　保証距離：1,000km\r\n保証費用は本体価格に含まれています。詳細については、販売店にご確認ください。\r\n弊社の自社保証は１ヵ月１０００ｋｍになりますが、別途【全国対応保証】をご準備しております。地域関係なく地元の提携工場様で受けることのでる保証となりますので、遠方のお客様も安心してご検討ください。', 2, 1, 719, 2000, '2WD', '8AT with floor MT mode', 'フロアMTモード付8AT', 5, 4, '14 (H26) / 06', '4655 x 1900 x 1675 (mm)', '2', '－ × － × － (mm)', '18.6 (km / L)', NULL, '2810mm', 'Light oil', '1840 / － / － (kg)', 'Four-wheel drive (4WD)', NULL, '5.7m', 'none', NULL, NULL, 'By repaid', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '前輪駆動(FF)', 'リ済込', 'レギュラー', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 1, 'なし'),
(13, '660 J CD Component AUX One Owner Warranty Manual', 'public/upload/car//9421599a9f0431e0e611b53a03437802.jpg', 'Body photo\r\n\r\nJ One Owner Warranty Manual CD Component AUX Keyless Key Electric Mirror Levelizer Electronic Stability Control Genuine Mat Door Visor Collision Mitigation Power Steering ABS Power Window W Airbag (1/56 sheets)\r\nJ One Owner Warranty Card Manual CD Component AUX Keyless Key Electric Mirror Levelizer Electronic Stability Control Genuine Mat Door Visor Collision Mitigation Power Steering ABS', '本体写真\r\n\r\nＪ　ワンオーナー　保証書　取説　ＣＤコンポ　ＡＵＸ　キーレスキー　電格ミラー　レベライザー　横滑り防止機能　純正マット　ドアバイザー　衝突軽減　パワステ　ＡＢＳ　パワーウィンドウ　Ｗエアバック(1/56枚)\r\nＪ　ワンオーナー　保証書　取説　ＣＤコンポ　ＡＵＸ　キーレスキー電格ミラー　レベライザー　横滑り防止機能　純正マット　ドアバイザー　衝突軽減　パワステ　ＡＢＳ', 6, 11, 1, 3, 3670.00, NULL, 10000, '2022-06-07 04:52:07', '2022-06-09 23:38:34', '660 J　CDコンポ　AUX　ワンオーナー　保証書 取説', 3, 'March 2023 (R05)', 'With statutory maintenance With\r\nstatutory 12-month inspection and maintenance * Commercial vehicles have 6-month inspection and maintenance\r\n. Batteries, brake pads, oils, AC filters, belts, valves, tires, etc. that are subject to replacement based on designated factories and certified factory standards. 』\\ It is safe maintenance', 'With warranty: Dealer warranty Warranty period: 1 month Warranty distance: Unlimited\r\nWarranty fee is included in the main unit price. Check with your retailer for more information.\r\nAll cars are guaranteed! !! Unlimited distance! !! In case of extension, there is also a 3-year paid warranty. In addition, although it is a paid warranty, we will provide aftercare for your car for 3 years with unlimited distance.', '2023(R05)年3月', '法定整備付\r\n法定12ヶ月点検整備付※商用車は6ヶ月点検整備付\r\n『法令１２か月点検または２４か月点検全車実施しております。指定工場、認証工場基準の交換対象バッテリー・ブレーキパット・オイル類・ＡＣフィルター・ベルト・バルブ・タイヤ等。』安心整備です', '保証付：販売店保証　保証期間：1ヵ月　保証距離：無制限\r\n保証費用は本体価格に含まれています。詳細については、販売店にご確認ください。\r\n全車保証付き！！距離無制限！！延長の場合３年有償保証もございます。また、有償保証ですが３年間、距離無制限で、お客様の車をアフターケアさせて頂きます。', 2, 1, 628, 660, '2WD', 'Instrument panel CVT', 'インパネCVT', 4, 5, '17