(21, 'Regius Ace 2.0 DX Just Low Long Body 6-seater Carrozzeria DVD Deck Keyless', 'public/upload/car//27.jpg', 'There is a residual value setting loan! Down payment, bonus 0 yen OK! You can order a new car for up to 10 years! Please contact us for your desired color and grade! You can negotiate a line! Line ID → kpnicemori', '残価設定ローンございます！頭金、ボーナス０円OK！最長１０年までございます新車注文できます！ご希望のカラー、グレードご相談ください！ライン商談できます！ラインID→kpnicemori', 1, 4, 9, 1, 99845.00, NULL, 10000, '2022-06-08 22:39:14', '2022-06-09 23:41:14', 'レジアスエース2.0 DX ジャストロー ロングボディ　6人乗り カロッツェリアDVDデッキ キーレス', 10, 'Vehicle inspection balance: None (newly acquired at the time of purchase\r\n) The total payment includes the costs required to acquire the vehicle inspection (vehicle weight tax, automobile liability insurance, etc.).\r\nVehicle inspection and maintenance with\r\nvehicle inspection and maintenance (legal 24-month inspection and maintenance / 12 months for commercial vehicles) will be carried out. The cost is included in the main unit price.', 'With statutory maintenance With\r\nstatutory 24-month inspection and maintenance * Commercial vehicles are\r\nequipped with an in-house maintenance factory with 12-month inspection and maintenance! Please leave after-sales follow-up such as vehicle inspection, repair, sheet metal etc. ☆ We also handle automobile insurance.', 'With warranty: Dealer warranty Warranty period: 1 month Warranty distance: Unlimited\r\nWarranty fee is included in the main unit price. Check with your retailer for more information.\r\nWarranty for up to 5 years anywhere in Japan for a separate fee ☆ [1 year electrical system] included! Mileage, number of repairs, unlimited repair amount ☆ For details, please contact the staff', '車検残：無（購入時に新規取得）\r\n車検の取得にあたって必要な費用（自動車重量税、自賠責保険料など）が支払総額に含まれています。\r\n車検整備付\r\n車検整備（法定24ヶ月点検整備／商用車は12ヶ月）を実施致します。その費用は本体価格に含まれています。', '法定整備付\r\n法定24ヶ月点検整備付※商用車は12ヶ月点検整備付\r\n自社整備工場完備です！車検、修理、板金等アフターフォローもお任せください☆自動車保険もお取り扱いしております。', '保証付：販売店保証　保証期間：1ヵ月　保証距離：無制限\r\n保証費用は本体価格に含まれています。詳細については、販売店にご確認ください。\r\n別途有償で全国どこでも最長５年保証☆〔電装系１年〕付！走行距離、修理回数、修理金額無制限☆詳しくはスタッフまで', 2, 1, 615, 2000, '2WD', 'Instrument panel 6AT', 'インパネ6AT', 6, 5, '16 (H28) / 06', '4695 x 1695 x 1985 (mm)', '2', '－ × － × － (mm)', '10.4 (km / L)', '-', '2570mm', 'regular', '1740 / － / － (kg)', 'Rear wheel drive (FR)', '-', '5m', 'none', NULL, NULL, 'By repaid', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '後輪駆動(FR)', 'リ済別', 'レギュラー', NULL, NULL, NULL, NULL, NULL, NULL, '-/-/-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Driver\'s seat / － / － / －', NULL, '-/-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '－/－/－', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '運転席/－/－/－', NULL, '－/－', NULL, NULL, 5, NULL),
(22, 'Mercedes-Benz E-Class Coupe E400 4matic Sport 4WD 2 Year Warranty EXC Shiv Panoramic Black Leather', 'public/upload/car//31.jpg', '■ MB certification 2 year warranty ■ Exclusive PKG ■ Panoramic SR ■ Blumester ■ Air balance package ■ Black genuine leather', '■ＭＢ認定２年保証■エクスクルーシブＰＫＧ■パノラミックＳＲ■ブルメスター■エアバランスパッケージ■黒本革', 13, 10, 10, 5, 461530.00, NULL, 27000, '2022-06-08 22:52:37', '2022-06-09 23:41:26', 'メルセデス・ベンツ EクラスクーペE400 4マティック スポーツ 4WD　2年保証 EXCシブ パノラミック 黒革', 10, 'Vehicle inspection balance: None (newly acquired at the time of purchase\r\n) The total payment includes the costs required to acquire the vehicle inspection (vehicle weight tax, automobile liability insurance, etc.).\r\nVehicle inspection and maintenance with\r\nvehicle inspection and maintenance (legal 24-month inspection and maintenance / 12 months for commercial vehicles) will be carried out. The cost is included in the main unit price.', 'With statutory maintenance With\r\nstatutory 24-month inspection and maintenance * For commercial vehicles, with 12-month inspection and maintenance\r\nWhen contracting, we will perform maintenance and inspection at our factory to obtain the manufacturer\'s warranty before delivery.\r\nCertified car warranty standards are strict, and we carry out maintenance that differs depending on the model year and mileage of the car.\r\nUp to 100 inspection and maintenance items are set.\r\nA service factory equipped with a full range of facilities that meet Daimler\'s strict service standards and service staff familiar with Mercedes-Benz will carefully carry out inspections and maintenance.', 'Warranty: Dealer Guarantee Warranty period: 24 months Warranty distance: Unlimited\r\nWarranty fee is included in the main unit price. Check with your retailer for more information.\r\nThe title of \"Mercedes-Benz Certified Car\" is given only to Mercedes that has cleared its own standards after thorough checks and maintenance.\r\nIn addition to a full manufacturer\'s warranty with unlimited mileage for 2 years, 24-hour touring support and a service network of authorized Mercedes-Benz dealers nationwide support you.\r\nYou can enjoy the quality of Mercedes to your heart\'s content with the utmost peace of mind and trust.', '車検残：無（購入時に新規取得）\r\n車検の取得にあたって必要な費用（自動車重量税、自賠責保険料など）が支払総額に含まれています。\r\n車検整備付\r\n車検整備（法定24ヶ月点検整備／商用車は12ヶ月）を実施致します。その費用は本体価格に含まれています。', '法定整備付\r\n法定24ヶ月点検整備付※商用車は12ヶ月点検整備付\r\nご契約の際は、ご納車前に弊社工場にてメーカー保証を取得する為の整備点検を行ないます。\r\nサーティファイドカー保証基準は厳しく、お車の年式、走行距離により異なる内容の整備を実施。\r\n最大で、１００項目にも及ぶ点検整備項目が設定されています。\r\nダイムラー社の厳しいサービス基準に適合した充実の設備を備えたサービス工場と、メルセデス・ベンツに精通したサービススタッフが点検整備を入念に実施いたします。', '保証付：ディーラー保証　保証期間：24ヵ月　保証距離：無制限\r\n保証費用は本体価格に含まれています。詳細については、販売店にご確認ください。\r\n徹底したチェックと整備を経て、独自の基準をクリアしたメルセデスだけに与えられる「メルセデス・ベンツ サーティファイドカー」の称号。\r\n２年間走行距離無制限の充実したメーカー保証はもちろん、２４時間ツーリングサポート、全国のメルセデス・ベンツ正規販売店によるサービスネットワークがあなたをサポート。\r\nこの上ない安心と信頼とともに、メルセデスのクオリティを心ゆくまでご堪能いただけます', 2, 1, 891, 2996, '4WD', 'Column 9AT with MT mode', 'コラムMTモード付9AT', 4, 2, '17 (H29) / 05', '4855 x 1860 x 1430 (mm)', '2', '－ × － × － (mm)', '10.7 (km / L)', '-', '2875mm', 'High octane', '1940 / － / － (kg)', 'Four-wheel drive (4WD)', '-', '5.4m', 'none', NULL, NULL, 'By repaid', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '四輪駆動(4WD)', 'リ済別', 'ハイオク', NULL, NULL, NULL, NULL, NULL, NULL, 'front / side / back', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Driver / Passenger / Side / Curtain', NULL, 'Blind spot /-', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'フロント/サイド/バック', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '運転席/助手席/サイド/カーテン', NULL, 'ブラインドスポット/－', NULL, NULL, 3, NULL),
