付\r\n１．契約後～納車までに法定点検を実施致します。　２．支払総額に整備代金を含んでおります。　３．点検記録簿が発行されます。', '保証付：販売店保証　保証期間：3ヵ月　保証距離：3,000km\r\n保証費用は本体価格に含まれています。詳細については、販売店にご確認ください。\r\n●期間中は何度でも使用可　※累積上限金額あり　●全国の店舗で対応可　●充実の保証範囲（３１８項目）　●最長１０年の有料保証。１・２・３・１０年からお選びいただけます　※車両により加入条件が異なります', 2, 1, 901, 2400, '4WD', '5AT with instrument panel MT mode', 'インパネMTモード付5AT', 5, 5, '12(H24)/10', '4535×1820×1685(mm)', '2', '2125×1540×1215(mm)', '11.6（km/L）', NULL, '2620mm', 'regular', '1540/－/－(kg)', 'Four-wheel drive (4WD)', NULL, '5.5m', 'without', NULL, NULL, 'Lijebetsu', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '四輪駆動(4WD)', 'リ済別', 'レギュラー', NULL, NULL, NULL, NULL, NULL, NULL, '-/-/Back', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Driver/Passenger/Side/Curtain', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '－/－/バック', NULL, NULL, NULL, NULL, NULL, NULL, NULL, '運転席/助手席/サイド/カーテン', NULL, NULL, NULL, NULL, 3, NULL);
